import React from 'react';
import Navbar from './Navbar';

const Homefront = () => {

    return (
        <> 
            <div className='hero'>
                <div className='hero-col'>
                    <h1>Matching <span>Style</span> and <span>Class</span><br />with Luxury and Comfort.</h1>
                    <p>You were born to be a Trend. You were meant to be here.<br /> This moment is yours.</p>
                    <a className='more_btn'>Go Shopping</a>
                </div>
                <div className='hero-col'>
                    <img src={require('../images/back.png')} alt='homebackground' />
                </div>
            </div>
        </>
    )

}

export default Homefront;
